insert into dataset select '10.5524/1000020', 'Foxtail millet (<em>Setaria italica</em>) (2n=18), is an annual grass grown both as cereal crop (grain production) and as forage food.  It is primarily grown in temperate, subtropical and tropical areas.  With approximately 6,000 varieties, millet is one member of the Panicoideae (grasses subfamily), which includes maize (<em>Zea mays</em>), sorghum (<em>Sorghum bicolor</em>), and sugar cane (<em>Saccharum officinarum</em>).  It is a nutritious dietary staple, containing starch, proteins, and a number of vitamins and minerals, such as calcium, iron, and sodium.  It feeds nearly one-third of the world population with main daily-calories intake, and is especially prevalent in dry climates or soil-poor regions that are not suited for the cultivation of many other crops.  Millet is self-pollinating, has a short lifecycle, is small in stature, and has a small genome size; all of these useful attributes make it an invaluable functional genomics model system, and an excellent reference genome to aid in the sequencing of other larger grasses genomes.', 'GigaScience', '2011/11/12', '1976-1-1', 'Genome data from foxtail millet (<em>Setaria italica</em>).', '1976-1-1', 'http://eol.org/pages/1114673/overview', 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/1000020/', 0.56, 'chengshf@genomics.cn' where not exists ( select null from dataset where identifier = '10.5524/1000020' and description = 'Foxtail millet (<em>Setaria italica</em>) (2n=18), is an annual grass grown both as cereal crop (grain production) and as forage food.  It is primarily grown in temperate, subtropical and tropical areas.  With approximately 6,000 varieties, millet is one member of the Panicoideae (grasses subfamily), which includes maize (<em>Zea mays</em>), sorghum (<em>Sorghum bicolor</em>), and sugar cane (<em>Saccharum officinarum</em>).  It is a nutritious dietary staple, containing starch, proteins, and a number of vitamins and minerals, such as calcium, iron, and sodium.  It feeds nearly one-third of the world population with main daily-calories intake, and is especially prevalent in dry climates or soil-poor regions that are not suited for the cultivation of many other crops.  Millet is self-pollinating, has a short lifecycle, is small in stature, and has a small genome size; all of these useful attributes make it an invaluable functional genomics model system, and an excellent reference genome to aid in the sequencing of other larger grasses genomes.' and publisher = 'GigaScience' and publication_date = '2011/11/12' and modification_date = '1976-1-1' and title = 'Genome data from foxtail millet (<em>Setaria italica</em>).' and release_date = '1976-1-1' and image_url = 'http://eol.org/pages/1114673/overview' and ftp_site = 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/1000020/' and dataset_size = 0.56 and submitter_email = 'chengshf@genomics.cn' ); 
